2013-09-29 thewaymouth aka mikedreams on the dock of The Pirate Bay

[The Daily Bleed Calendar in coagulation with nice dreams presents...]

SEPTEMBER 29

Mexico: FESTIVAL OF TEZCATZONCTL, chief God of Intoxication.

MICHAELMAS: Originally placed in December by the Church to overwrite existing pagan celebrations. When, in the 12th Century, the fixed date of Christmas becomes a sufficiently important date (see 25 December), Michaelmas itself is re-deployed to overwrite other pagan celebrations around the autumn equinox.

Feast then on me and my seed.


Meanwhile, back in the states of grace, I'm on the highway to the hills are alive with the sound of hell's belle's ringing. 

@ 2:44 Taylor spreads out her wings straight across, and sings loud sweet loud to the sky spread out before her: 

'Come back and tell me why/ I'm feeling I've missed you all this time...'

And suddenly then, a heavenly chorus of hope from her backup singers breezes on through, @ 2:54 Taylor smiles as she caught awares, and starts to gently flap one wing and then the other . . . 

And you could swear she was gonna fly before your eyes. And all you know is now you already are up there if you have a heart cause it's just been set free from the cage of its strings.

And she sings, 'And meet me there tonight/ And let me know that it's not all in my mind.'


She's The Queen Bee's Knees.


It's The Swift End Of The Pop World As We Know Hot Shit (And I Feel Everything Has Changed) 
